const socket = io('http://192.168.8.13:3000');

const messageForm = document.getElementById('send-container');
const messageInput = document.getElementById('message-input');
const messageContainer = document.getElementById('message-container')

const userName = prompt('What is your name');


window.appendMessage = function (message, selfSent = false, username = 'No') {
    const rowDiv = document.createElement('div')
    rowDiv.classList.add('row');
    const colDiv = document.createElement('div')
    colDiv.classList.add('col-10');
    const colDivOne = document.createElement('div')
    colDivOne.classList.add('col-1');


    const msgElement = document.createElement('div');

    msgElement.classList.add('messageContainerDIV');
    msgElement.innerHTML = message;
    if (!selfSent) {
        messageContainer.append(document.createElement('br'))
    }

    colDiv.appendChild(msgElement)
    rowDiv.appendChild(colDivOne)
    rowDiv.appendChild(colDiv)

    const spnText = document.createElement('span');
    spnText.classList.add('whiteText');
    spnText.classList.add('messageUsersNames');
    const faceImage = document.createElement('img');
    if (username != 'No') {

        spnText.innerHTML = username;
        

        faceImage.classList.add('imgFaceLeft');

        faceImage.src = "data:image/jpeg;base64,"

    } else {
        spnText.innerHTML = userName;
        spnText.classList.add('floatRightName')

        faceImage.classList.add('imgFaceRight');

        faceImage.src = "data:image/jpeg;base64,";
        
    }//spnText
    const dr = document.createElement('div');
    dr.classList.add('row');
    const dc = document.createElement('div');
    dc.classList.add('col');

    const drt = document.createElement('div');
    drt.classList.add('row');
    drt.classList.add('imageParent');
    const dct = document.createElement('div');
    dct.classList.add('col');


    
    faceImage.classList.add('imgFace');

    dc.appendChild(spnText)
    dr.appendChild(dc)

    // dct.appendChild(faceImage)
    // drt.appendChild(dct)
    // messageContainer.appendChild(drt);

    // messageContainer.appendChild(faceImage);
    messageContainer.appendChild(dr);
    messageContainer.appendChild(rowDiv);
    // messageContainer.append(document.createElement('br'))
}

appendMessage('Welcome ' + userName);
socket.emit('online-user', userName)

socket.on('chat-message', data => {

    console.log(data);
})
socket.on('chat-broadcast-message', broadcast => {
    appendMessage(broadcast.message, false, broadcast.user);
})

socket.on('chat-user-connected', newUser => {
    appendMessage('New User Connected: ' + newUser);
})
socket.on('chat-user-disconnected', user => {
    appendMessage(user + ' Disconected');
})

socket.on('chat-user-connected', newUser => {
    appendMessage('New User Connected: ' + newUser);
})

messageForm.addEventListener('submit', e => {
    e.preventDefault();
    appendMessage(messageInput.value, true)
    socket.emit('send-chat-message', messageInput.value)

    messageInput.value = '';
})

